  return (
    <div className="body">
      <Header/>
      {/* <Baenner/> */}

      <Routes>
        <Route path='/' element={<MainPaga/>}></Route>
        <Route path='/login' element={<Login/>}></Route>
      </Routes>

      {/* <Footer/> */}
    </div>
  );
}

export default App;
